comment_data.body:
@mit-mit: I had the debugging error in one of my projects as I tried to use QR-Code scanning in my own flutter app. To make the error reproducible and eliminate own mistakes, I tried to get the same error with the example code. The first error I've got was #466. After detecting a workaround, I could document the second error with debugging. Sorry for the bad report. I should have mentioned that I created the flutter.yaml file manually (My workaround in #466).

I deleted my hello_service example and followed your instructions with a new copy of the example from github. It worked fine. I could start the app without creating the flutter.yaml file manually. So your instructions are the better workaround for opening the example projects. 

Anyway, the debugger did't stop at breakpoints. 

@eseidelGoogle: It was not necessary to create the `android/local.properties` file manually (like descriped in the `README.md`). After following the instructions from mit-mit the file was automatically created, the app starts on my android phone after building in IntelliJ and the geolocation button also works fine.
